import { combineReducers } from 'redux';

import AllGenresReducer from './genres/reducer/AllGenresReducer';
import IndividualGenreReducer from './genres/reducer/IndividualGenreReducer';
import auth from './auth/reducer/auth';
import channels from './channels/reducer/channels';

export const reducers = combineReducers({ AllGenresReducer, IndividualGenreReducer, auth, channels });
